import timefrom typing import Callabledef count_time(func: Callable):    def wrapper(*args, **kwargs):        start = time.time()        res = func(*args, **kwargs)        end = time.time()        print(f'Funksiya {(start - end):.5f} vaqt davomida ishladi')        return res    return wrapper@count_timedef increace_n(n):    ls = []    for i in range(n):        for x in range(10, 100_000):            ls.append(i * x)    return lsincreace_n(52)